$(function() {

	$.ajaxSetup({
		cache: false,
		headers: {
			'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
		}
	});

	$.validator.setDefaults({
		highlight: function(element) {
			$(element).closest('.form-group').addClass('has-error');
		},
		unhighlight: function(element) {
			$(element).closest('.form-group').removeClass('has-error');
		},
		errorElement: 'span',
		errorClass: 'help-block',
		errorPlacement: function(error, element) {
			if(element.parent('.input-group').length) {
				error.insertAfter(element.parent());
			} else if (element.parent('.radio-inline').length) {
				error.insertAfter(element.parent().parent());
			} else {
				error.insertAfter(element);
			}
		}
	});

    $('form[enctype="multipart/form-data"]').on('submit', function(e){
        $(this).find('input[type=file]').each(function(){
            var file = $(this);
            if (file.val() == "") file.remove();
        });
        return true;
    });

	$('.validateForm').validate();

	$('body').on('click', 'a.removeOptionFromGroupButton', function (e) {

		e.preventDefault();

		var button = $(this);
		var option = button.data('option-id');
		var group = button.data('group-id');

		swal({
			title: "Are you sure?",
			text: "You cannot reverse this!",
			type: "warning",
			showCancelButton: true,
			cancelButtonText: "No",
			confirmButtonColor: "#DD6B55",
			confirmButtonText: "Yes!",
			closeOnConfirm: true
		},
		function(){

			$.ajax({
                method: "POST",
                url: "/admin/accomodation_facilities/groups/facilities/remove",
                data: { facility: option, group: group }
            })
            .success( function( response ) {
                
                button.parent('li').fadeOut( function(){
                    button.parent('li').remove();
                });

                $.bootstrapGrowl("Option removed", {
                	ele: 'body',
                	type: 'success',
                	offset: {from: 'bottom', amount: 20},
                	align: 'right',
                	width: 'auto',
                	delay: 1000,
                });

            });

		});
            
        
    });

	$('body').on('click', 'a', function (ev) {
        var $a = $(this);
        if($a.data('method') === 'DELETE') {
            ev.preventDefault();

            swal({
            	title: "Are you sure?",
            	text: "You cannot reverse this!",
            	type: "warning",
            	showCancelButton: true,
            	cancelButtonText: "No",
            	confirmButtonColor: "#DD6B55",
            	confirmButtonText: "Yes!",
            	closeOnConfirm: false
            },
            function(){
            	makeRequest($a.data('method'), $a.attr('href'));
            });
            
        }
    });

    var makeRequest = function (method, target) {

        if(method === 'GET') {
            window.location.href = target;
            return;
        }

        var html = '<form id="deleteForm" action="'+target+'" method="POST" style="display: none;">';
            html += '<input type="hidden" name="_method" value="'+method+'">';
            html += '<input type="hidden" name="_token" value="'+ $('meta[name="csrf-token"]').attr('content') +'">';
        html +=    '</form>';

        $('body').append(html);
        $('#deleteForm').submit();

    };

});